    data: |
      SELECT DISTINCT + col1 * - + 5 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT + + col0 * - col1 - - col2 = + col2;
  - name: tab0

outputs:
  - name: q7531.out
    data: |
      -105
      -405
      -5
